import {Link} from 'react-router-dom';
import style from './Footer.css'

class Footer extends Component {
    render() {
        return (
            <div className='footer'>

                <div className="container-fluid text-center pb-5">
                <hr className="my-5" />

                <small className="text-muted">all rights reserved Â© <strong>LiteCnC</strong>2022 |
                     Powered by <a className="" href="https://wofbusiness.company.site/" target="_blank">WOF</a>
                     </small>   <ul className='footer-list'>
                        <li className='list-footer'>Privacy Policy</li>
                        <li className='list-footer'>Terms</li>
                        <li className='list-footer'>Conditions</li>
                        <li className='list-footer'>Partners</li>
                        <li className='list-footer'>User regulations</li>
                        <li className='list-footer'>Our Services</li>
                     </ul>

            </div>
            </div>

        );
    }
}

export default Footer;
